import React, { Component } from 'react'

export default class createproject extends Component {
    render() {
        return (
            <div>
                <div  className="page-header">
          <h3 className="page-title"> Create Project </h3>
          <nav aria-label="breadcrumb">
          <a  href=""class="btn btn-primary" title="Download Template" onClick={()=>this.props.history.push('/form-elements/createproject')}><i className="fa fa-plus-square"></i> </a> <a  href=""class="btn btn-primary" title="Download Template" onClick={()=>this.props.history.push('/form-elements/copyprojects')}><i className="fa fa-cloud-download"></i> </a>
          </nav>
        </div>
            </div>
        )
    }
}
